def find_primes_between_indices(int_list):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i==0:
                return False
        return True

    primes_list = [x for x in int_list[287:929] if is_prime(x)]
    primes_list.sort()

    return primes_list
